```go
func (cb *CircuitBreaker) onSuccess(state State, now time.Time) {
	//...
	case StateHalfOpen:
		cb.counts.onSuccess()
		if cb.counts.ConsecutiveSuccesses >= cb.maxRequests {
			cb.setState(StateClosed, now)
		}
	}
}
